import React from 'react';
import './App.css';
import { BrowserRouter as Router } from 'react-router-dom'
import{Switch, Route} from "react-router";
import Header from "./Header";

function App() {


  return (
    <Router> 
    <div className="App">

      <Switch> 
          <Route path="/checkout">
            <h1>checkout</h1>
          </Route>

          <Route path="/login">
            <h1>Login</h1>
          </Route>
          <Route path="/signup">
            <h1>Signup</h1>
          </Route>


          <Route path="/">
            <Header /> 
            <h1>Homepage</h1>

          </Route>
      </Switch>

    </div>
    </Router>
  );
}

export default App;
